import React from 'react';
import './App.css';

class Counter extends React.Component {
  constructor(props) {
    super(props)
    this.state =  {
      count: 0
    }
  }

  render() {
    return <div>{this.state.count}</div>
  }
}

class App extends React.Component {

  render() {
    return (
      <Counter />
    );
  }
}

export default App;
